import styled from 'styled-components';

export const StyledContent = styled.div`
    padding: 5px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items:center;
    max-width: 75em;
    background: ${({ theme }) => theme.primaryLight};
`;
